import React from 'react';
import './App.css';
import {allCards} from './services/cardService'
import 'vanilla-framework/scss/build.scss';

async function loadNames() {
  const response = await fetch('https://people.canonical.com/~anthonydillon/wp-json/wp/v2/posts.json');
  const names = await response.json();
  console.log(names); 
  const result = Object.entries(names);
  console.log(result)
  for (const k in result) {
    const b = result[k];
    //console.log(b);
    const resu = Object.entries(b);
    const text: any = resu[1][1];
    const text1: any = text['title']['rendered']
    console.log(text1)
  }
  // logs [{ name: 'Joker'}, { name: 'Batman' }]
}
loadNames();
allCards();

function App() {
  return (
    <div className="row">
      <div className="col-5">
        <div className="p-card u-no-padding">

          <div className="p-card__inner">
            <h3>The State of Robotics - August 2021</h3>
            <p>From robots learning to encourage social participation to detect serious environmental problems, it was a learning month.</p>
          </div>
          <hr className="u-no-margin--bottom">
          <div className="p-card__inner">
            by <a href="#">Bartek Szopka</a> on 21st August 2021
          </div>
        </hr>
      </div>
    </div>
    </div>
  );
}

export default App;
